import React from 'react';
import {Link} from 'react-router-dom';
import { ReactComponent as Logo} from '../../assets/corona.svg';

import './header.styles.scss';

const Header = () => (
	<div className='header'>
		<Link to='/'><Logo/></Link>
	</div>
);

export default Header;
